import React, { } from "react";
import { Box, FormControl, Grid, Input, InputLabel, Paper, TextField } from "@mui/material";
import Base from "../components/Base";
import TableComponentCart from "../components/TableCart";

function Cart() {
  return (
    <Base title="Carrinho de Compras">
      <Paper sx={{ flexGrow: 1 }}>
        <Grid container spacing={2} mt={2}>
          <Grid item lg={12}>
            <TableComponentCart />

          </Grid>
        </Grid>
        <Grid container
          direction="row"
          justifyContent="center"
          alignItems="center" >
            <FormControl >
              <InputLabel htmlFor="input-with-icon-adornment">
                With a start adornment
              </InputLabel>
              <TextField
              margin={2}
                id="input-with-icon-textfield"

              />
            </FormControl>
        </Grid>
      </Paper>
    </Base >
  );
}

export default Cart;
